@CraginPark @penelope7usa "Pre mil dispensationalism just makes sense."

No, regardless of what it be called, selling out your own nation to Israel, selling out your own people to Israel, selling out Christianity to Israel and Zionism, makes no sense.

Unless you want to get rich on those 30 shekels.

